import React,{useState,useEffect} from 'react'

function UseEffect5() {
    const [count,setCount] = useState(0)

    const tick = () =>{
        setCount(count +1)
    }
    useEffect (()=>{
        const interval = setInterval (tick,1000)
        return () =>{
            clearInterval
        }
    } ,[])
  return (
    <div>
     {count}
    </div>
  )
}

export default UseEffect5
